onalInfo":"","additionalTicketText":"","ageLimitCode":null,"ageLimit":"","showTypeCode":null,"showType":"","eventStatusCode":"BUY","eventStatus":"Buy","eventStatusMessage":"","ticketPurchaseUrl":"https://www.ticketfly.com/purchase/event/1290871?utm_medium=api","ticketPrice":"$55.00","externalTicketingUrls":[],"multiEventCartable":true,"facebookEventId":326428121039007,"facebookEventIdString":"326428121039007","headliners":[{"id":1048933,"name":"Dave Mason","startTime":null,"eventDescription":"Take a journey back to the greatest days of rock with Dave Mason's Traffic Jam. Join Rock and Roll Hall of Famer and co-founder of the legendary band Traffic, Dave Mason for an evening of music history as he retraces the earliest days of his career with Traffic and the works that launched his successful solo career. Mason founded Traffic with Steve Winwood while both were still teenagers, and created music that would find its' way into the hearts of generations of music lovers. He would go on to establish himself as a successful songwriter, guitarist and solo artist. He's penned dozens of hits, and his legendary guitar work has been linked with numerous other members of rock and roll elite, including Eric Clapton, Stevie Wonder, Michael Jackson, Fleetwood Mac, The Rolling Stones, Graham Nash, Stephen Stills, Rita Coolidge, Leon Russell, Ron Wood, and Mama Cass Elliot. Traffic Jam is one show you should not miss.

